import React from "react";
import Navbar from "../Navbar";
import Footer from "../Footer";
import './Home.css';
import Card from "../Card";

function Home() {
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div><Card/></div>
      <div>
        <Footer />
      </div>
    </>
  );
}

export default Home;
